import React from "react";

export function Navbar () {
    return (
        <>
            <nav>
            <a href="index.html"><img src="plane.jpg" width="175" height="175" alt="logo"/></a>
            <h1>AIRTRACK</h1>
            <div class="nav-links">
                <ul>
                <li><a href="index.html">HOME</a></li>                     
                <li><a href="about.html">ABOUT US</a></li>
                    <li><a href="appointment.html">FLIGHTS</a></li>
                <li><a href="complaint.html">BOOKING</a></li>
                <li><a href="loginsign.html">LOGOUT</a></li>
                </ul>
            </div>
        </nav>
        </>
    );
}
